import React from 'react'
import { useNavigate } from 'react-router-dom'
import './logo.scss'

const Logo = () => {
  const navigate = useNavigate()

  return (
    <div>
      <a href='/' className='asideBar__logo'>
        Tasks Book
      </a>
    </div>
  )
}

export default Logo
